#include "trigger.h"

Trigger::Trigger(unsigned int MAX_PLAYERS, bool ZERO_DELAY) {
	this->MAX_PLAYERS = MAX_PLAYERS;
	this->ZERO_DELAY = ZERO_DELAY;
}

Trigger::~Trigger() {

}

void Trigger::shoot(unsigned int delayBefore, unsigned int delayAfter) {
	Sleep(delayBefore);
	m->WriteMem<int>(m->cDll.dwBase + offsets::dwForceAttack, 5);
	Sleep(20);
	m->WriteMem<int>(m->cDll.dwBase + offsets::dwForceAttack, 4);
	Sleep(delayAfter);
}

bool Trigger::logic() {
	srand(time(NULL));

	unsigned int crosshair = pLocal->getCrosshair();

	if (crosshair != 0 && crosshair < MAX_PLAYERS) {
		DWORD e = m->ReadMem<DWORD>(m->cDll.dwBase + offsets::dwEntityList + ((crosshair - 1) * 0x10));
		int eTeam = m->ReadMem<int>(e + offsets::m_iTeamNum);
		int eHealth = m->ReadMem<int>(e + offsets::m_iHealth);
		int myTeam = pLocal->getTeam();

		if (eTeam != myTeam && eHealth > 0)
			return true;
		else
			return false;
	} else
		return false;
}

void Trigger::trigger() {
	bool keyHeld = false;

	if (GetAsyncKeyState(KEY_TRIGGER) == keyDown && !keyHeld) {
		keyHeld = true;
	}
	if (GetAsyncKeyState(KEY_TRIGGER) == keyUp && keyHeld) {
		keyHeld = false;
	}

	if (keyHeld) {
		if (logic()) {
			if (ZERO_DELAY) {
				int beforeShot = 0;
				int afterShot = 0;
				shoot(beforeShot, afterShot);
			} else {
				int beforeShot = rand() % 149 + 27;
				int afterShot = rand() % 21 + 50;
				shoot(beforeShot, afterShot);
			}

		}
	}
}

